import React from "react";
import { Typography, ThemeProvider, Button } from "@mui/material";
import { createTheme } from "@mui/material";
import PhoneIcon from "@mui/icons-material/Phone";

const theme = createTheme({
  typography: {
    fontFamily: ["Chilanka", "cursive"].join(","),
  },
});

const Firstpage = (props) => {
  return (
    <ThemeProvider theme={theme}>
      <header className="header">
        <div className="h2">
          <div className="h1">
            <Typography style={{ color: "blue", textDecoration: "underline" }}>
              Home
            </Typography>
          </div>
          <div className="h1">
            <Typography>9th-10th</Typography>
          </div>
          <div className="h1">
            <Typography>11th-12th</Typography>
          </div>
          <div className="h1">
            <Typography>Undergraduate</Typography>
          </div>
          <div className="h1">
            <Typography>Study Abroad</Typography>
          </div>
          <div className="h1">
            <Typography>Blog</Typography>
          </div>
          <div className="h1">
            <PhoneIcon />
          </div>
          <div style={{ margin: 15 }}>
            <Button variant="contained" size="large">
              Book Now
            </Button>
          </div>
        </div>
      </header>
      <section1>
        <img
          src={{
            url: "https://images.unsplash.com/photo-1642543492366-a92039433543?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=387&q=80",
          }}
          height="400px"
          width="400px"
        />
      </section1>
    </ThemeProvider>
  );
};

export default Firstpage;
